script: |
  super -f text -I q7948.spq | sort > q7948.out

inputs:
  - name: q7948.spq
    data: |
      SELECT DISTINCT + col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT + col2 - col0 BETWEEN ( - 33 + col2 ) AND NULL;
  - name: tab1

outputs:
  - name: q7948.out
    data: |
      51
      85
      91
